const styles = theme => ({
    root: {
        position:'fixed',
        top:0,
        left:0,
        bottom:0,
        right:0,
        height: '100%',
        backgroundImage: `url('https://gw.alipayobjects.com/zos/rmsportal/TVYTbAXWheQpRcWDaDMu.svg')`
    },
    content: {
        height: '100%'
    }
});
export default styles;
